import React from 'react';
import classes from './navbar.module.css';

function Navbar(props) {
    return (
      <div className= {classes.navbar}>
        Icon
        <ul className = {classes.navlist}>
            <li>Home</li>
            <li>Fashion</li>
            <li>Kitchen</li>
        </ul>
      </div>
    );
  }
  
  export default Navbar;
